import React from 'react'
import Todo from './Todo'

const List = ({todo}) => {
    return (
        <div>
            {todo.map((todoItem) => {
                todoItem.text = todo.text;
                todoItem.id = todo.id;
            })}
        </div>
    )
}

export default List
